import React, {useEffect} from "react";
import "./Dice.scss"

type DiceProps = {
    header: string,
    options: string[],
    active: number
}

const Dice: React.FC<DiceProps> = ({header, options, active}) => {

    return (
        <div className="Dice">
            <h4>{header}</h4>
            <div className="Square">
                <h5>{options[active]}</h5>
            </div>
        </div>
    )
};

export default Dice
